import React from "react";
import styles from './MealItemForm.module.css'
const MealItemForm = () => {
return(
    <div>
    <div className={styles.container}>
        <h3>Amount</h3>
        <div className={styles.amount}>3</div>
    </div>
    <button>+</button>
    </div>
)
}

export default MealItemForm;
